import './Expenses.css'
import ExpenseItem from './ExpenseItem';

function Expenses(props) {
  const Array = [...props.array]

  return(
    <>
     <ExpenseItem
				title={Array[0].title}
				amount={Array[0].amount}
				date={Array[0].date}
			/>
    {Array.forEach((element) =>{
      <div>
        return (<ExpenseItem 
        title={element.title}
				amount={element.amount}
				date={element.date}
      />);
      </div>
    })}
    </>

  );
}

export default Expenses;
